  }

  const approveSound = new Audio("/images/sound/accept.mp3")

  const approveSound1 = () => {        
    approveSound.play()    
  }



const StyledCardBody = styled(CardBody)`
  height: 100%;
  display: flex;
  flex-direction: column;
  align-items: center;
  background-color: #1B2028; 
  color: white !important;
  border-color: #faa21a;    
`

const StyledButton = styled.button`
  order: 4;
  align-items: center;
  border-radius: 12px;
  border-color: #0095EC;
  padding: 12px;
  margin-top: 20px;
  cursor: pointer;
  display: inline-flex;
  width: 94%;
  font-family: inherit !important;
font-style: normal !important;
font-weight: 500 !important;
font-size: 20px !impotant;
  justify-content: center;
  letter-spacing: 0.03em;
  color: #FFFFFF;
  transition: background-color 0.2s, opacity 0.2s;

  &:hover {
    opacity: 0.65;
  }

  &:active {
    opacity: 0.85;
    transform: translateY(1px);
    box-shadow: none;
  }
`;


const StyledButton2 = styled.button`
  order:2;
  align-items: center;
  border: 0;
  border-radius: 15px;
  padding: 12px;
  margin-top: 5px;
  display: inline-flex;
  width: 30px;
  height: 30px;
  background-color: #FFFFFF;
  font-family: inherit;
  font-size: 16px;
  justify-content: center;
  letter-spacing: 0.03em;
  color: #faa21a;
  transition: background-color 0.2s, opacity 0.2s;

  &:hover {
    opacity: 0.65;
  }

  &:active {
    opacity: 0.85;
    transform: translateY(1px);
    box-shadow: none;
  }
`;


const InputStyle = styled.div`
  display: flex;
  flex-direction: column;
  width: 100%;
  border: 1px solid;
  border-radius: 10px;
  border-color: rgba(29, 29, 29, 0.05);
  padding: 5px;
  background: #272f37 !important;
  background: linear-gradient(to right,  #272f37 59%, #292929 0%) !important;
  font-size: 10px !important;
  color: white !important;
`

const StyledLoading = styled.div`
  order: 4;
  align-items: center;
  border: 1;
  border-color: #0095EC;
  // box-shadow: 0 0 6px #f8981d;
  border-radius: 12px;
  padding: 12px;
  margin-top: 20px;
  cursor: pointer;
  display: inline-flex;
  width: 94%;
  font-family: inherit;
  font-size: 26px !important;
  // font-weight: 600;
  justify-content: center;
  letter-spacing: 0.03em;
  background-image: grey;
  color: #faa21a;
  transition: background-color 0.2s, opacity 0.2s;
  disabled !important;

  &:hover {
    opacity: 0.65;
  }

  &:active {
    opacity: 0.85;
    transform: translateY(1px);
    box-shadow: none;
  }
`;


const Cards = styled(BaseLayout)`
  align-items: stretch;
  justify-content: stretch;
  margin-bottom: 24px;
  grid-gap: 24px;
  width: 100%;

  & > div {
    grid-column: span 12;
    background-color: #1B2028 !important; 
  }

  ${({ theme }) => theme.mediaQueries.sm} {
    & > div {
      grid-column: span 12;
      background-color: #1B2028 !important;       
    }
  }
  ${({ theme }) => theme.mediaQueries.md} {
    & > div {
      grid-column: span 6;
      background-color: #1B2028 !important; 
    }
  }

  ${({ theme }) => theme.mediaQueries.lg} {
    margin-bottom: 32px;
    grid-gap: 32px;

    & > div {
      grid-column: span 3;
    }
  }
`

const BiggerCards = styled(Cards)`
  ${({ theme }) => theme.mediaQueries.sm} {
    & > div {
      grid-column: span 12;
      font-size: 0.5em;
      border-radius:20px;          
      background-color: #1B2028 !important;
      border: 1; 

      position: relative;
      margin: 0 auto;
      box-shadow: 0px 4px 20px rgba(0, 0, 0, 0.01), 0px 12px 40px rgba(0, 0, 0, 0.02), 0px 8px 24px rgba(0, 0, 0, 0.02);

    }
  }
  ${({ theme }) => theme.mediaQueries.lg} {
    & > div {
      grid-column: span 12;
      background-color: #1B2028 !important;
    }
  }
`

const Label = styled.div<{ labelSize: string }>`
font-size: 14px;
color: #fff !important;
margin-top:10px 30px;
padding-top:20px;
`

